@-moz-document domain("codingbat.com") {
body {
    background-color: /*[[color]]*/;
	font-family: "Gotham SSm A","Gotham SSm B",Helvetica,Arial,sans-serif;
    font-weight: 300;
    font-size: 100%;
    line-height: 28px;
    margin-left: 0;
    color: #E0DDF0;
  }

  a, :link {
    color: #18a3fa;
  }

  a:visited {
	color: #069fff;
  }

  div.tabin {
    background-color: /*[[color]]*/;
    border-top: 1px solid white;
  }
  
  #selected {
    background: #1f1f1f;
  }
  
  div.summ {
    background-color: #1d1d1d;
  }

  button, button.go, button.gray {
    background-color: #252526;
    color: #E0DDF0;
    box-shadow: 0 2px 0 -1px #1C1C1C,0 2px 0 #252526;
    text-shadow: none;
    background-image: none;
  }
  
  /* - Images -
  
     The default images are replaced using only CSS,
     by images with transparent backgrounds by hiding the image,
     giving the element a padding of the original image size and
     updating its background.
  */
  
  img[src="/c1.jpg"] { /* Check 1 */
    width: 0;
    height: 0;
    padding: 8px 8px 8px 7px;
    background: url('data:image/png;base64,');
  }
  
  img[src="/c2.jpg"] {  /* Check 2 */
    width: 0;
    height: 0;
    padding: 8px 8px 8px 7px;
    background: url('data:image/png;base64,');
  }
  
  img[src="/c3.jpg"] {  /* Check 3 */
    width: 0;
    height: 0;
    padding: 8px 8px 8px 7px;
    background: url('data:image/png;base64,');
  }
  
  img[src="/s1.jpg"] { /* Star 1 */
    width: 0;
    height: 0;
    padding: 10px;
    background: url('data:image/png;base64,');
  }
  
  img[src="/s2.jpg"] { /* Star 2 */
    width: 0;
    height: 0;
    padding: 10px;
    background: url('data:image/png;base64,');
  }

  img[src="/c2big.jpg"] {
	width: 0;
	height: 0;
	padding: 25px;
	background:
url('data:image/png;base64,')
  }

  img[src="/s2big.jpg"] {
	width: 0;
	height: 0;
	padding: 25px;
	background:
url('data:image/png;base64,')
  }
  
  img[src="/s5j.png"]
  img[src="/s10j.png"],
  img[src="/s25j.png"],
  img[src="/s5p.png"],
  img[src="/s10p.png"],
  img[src="/s25p.png"],
  img[src="/s2big.jpg"],
  img[src="/c2big.jpg"] {  /* Give the big images a border */
    border: 1px solid #666;
  }
  
  .ace-chrome .ace_gutter {
  background: #1a0005;
  color: steelblue
}

.ace-chrome .ace_print-margin {
  width: 1px;
  background: #1a1a1a
}

.ace-chrome {
  background-color: /*[[editorcolor]]*/;
  color: #DEDEDE
}

.ace-chrome .ace_cursor {
  color: #9F9F9F
}

.ace-chrome .ace_marker-layer .ace_selection {
  background: #424242
}

.ace-chrome.ace_multiselect .ace_selection.ace_start {
  box-shadow: 0 0 3px 0px black;
}

.ace-chrome .ace_marker-layer .ace_step {
  background: rgb(0, 0, 0)
}

.ace-chrome .ace_marker-layer .ace_bracket {
  background: #090;
}

.ace-chrome .ace_marker-layer .ace_bracket-start {
  background: #090;
}

.ace-chrome .ace_marker-layer .ace_bracket-unmatched {
  margin: -1px 0 0 -1px;
  border: 1px solid #900
}

.ace-chrome .ace_marker-layer .ace_active-line {
  background: #2A2A2A
}

.ace-chrome .ace_gutter-active-line {
  background-color: #2A112A
}

.ace-chrome .ace_marker-layer .ace_selected-word {
  border: 1px solid #424242
}

.ace-chrome .ace_invisible {
  color: #343434
}

.ace-chrome .ace_keyword,
.ace-chrome .ace_meta,
.ace-chrome .ace_storage,
.ace-chrome .ace_storage.ace_type,
.ace-chrome .ace_support.ace_type {
  color: tomato
}

.ace-chrome .ace_keyword.ace_operator {
  color: deeppink
}

.ace-chrome .ace_constant.ace_character,
.ace-chrome .ace_constant.ace_language,
.ace-chrome .ace_constant.ace_numeric,
.ace-chrome .ace_keyword.ace_other.ace_unit,
.ace-chrome .ace_support.ace_constant,
.ace-chrome .ace_variable.ace_parameter {
  color: #E78C45
}

.ace-chrome .ace_constant.ace_other {
  color: gold
}

.ace-chrome .ace_invalid {
  color: yellow;
  background-color: red
}

.ace-chrome .ace_invalid.ace_deprecated {
  color: #CED2CF;
  background-color: #B798BF
}

.ace-chrome .ace_fold {
  background-color: #7AA6DA;
  border-color: #DEDEDE
}

.ace-chrome .ace_entity.ace_name.ace_function,
.ace-chrome .ace_support.ace_function,
.ace-chrome .ace_variable {
  color: #7AA6DA
}

.ace-chrome .ace_support.ace_class,
.ace-chrome .ace_support.ace_type {
  color: #E7C547
}

.ace-chrome .ace_heading,
.ace-chrome .ace_string {
  color: #B9CA4A
}

.ace-chrome .ace_entity.ace_name.ace_tag,
.ace-chrome .ace_entity.ace_other.ace_attribute-name,
.ace-chrome .ace_meta.ace_tag,
.ace-chrome .ace_string.ace_regexp,
.ace-chrome .ace_variable {
  color: #D54E53
}

.ace-chrome .ace_comment {
  color: orangered
}

.ace-chrome .ace_indent-guide {
  background: url(data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAACCAYAAACZgbYnAAAAEklEQVQImWNgYGBgYLBWV/8PAAK4AYnhiq+xAAAAAElFTkSuQmCC) right repeat-y;
}
}
